{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/geolffreymena/google-data-analytics-capstone-bellabeat?scriptVersionId=137296388\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"0ec95035","metadata":{"papermill":{"duration":0.008187,"end_time":"2023-07-19T19:53:11.757829","exception":false,"start_time":"2023-07-19T19:53:11.749642","status":"completed"},"tags":[]},"source":["## **Introduction**\n","\n","Hello, my name is Geoffrey Mena, and I'm a Data Analyst consultant working with Bellabeat. Bellabeat is a thriving small company that has the potental to make a significant impact in the global smart device market. With the vision of Urška Sršen, the co-founder and Chief Creative Officer of Bellabeat, the company believes that analyzing smart device fitness data can uncover new growth opportunities.\n","\n","As part of my role, I have been assigned to focus on one of Bellabeat's products and analyze relevant smart device data. The objective is to gain valuable insights into consumer usage patterns and behaviors. Bellabeat has entrusted me with the responsibility of analyzing a dataset aligned with their smart device product line. My findings will be used to shape the company's marketing strategy.    \n","\n","### Stakeholders \n","\n","* **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer\n","* **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","* **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy. You joined this team six months ago and have been busy learning about Bellabeat’’s mission and business goals — as well as how you, as a junior data analyst, can help Bellabeat achieve them."]},{"cell_type":"markdown","id":"53f90689","metadata":{"papermill":{"duration":0.006432,"end_time":"2023-07-19T19:53:11.771033","exception":false,"start_time":"2023-07-19T19:53:11.764601","status":"completed"},"tags":[]},"source":["## **Ask**    \n","\n","Following several meetings, Mrs. Sršen has entrusted me with the task of analyzing smart device usage data to gain valuable insights into how consumers utilize non-Bellabeat smart devices. Additionally, she has requested that I select one specific Bellabeat product to apply these insights to in my upcoming presentation.\n","\n","By conducting a thorough analysis of consumer behavior with regards to non-Bellabeat smart devices, I aim to provide comprehensive insights that can inform our understanding of the market landscape. These insights will then be utilized to tailor our approach and optimize the marketing strategy for a chosen Bellabeat product. I am eager to delve into the data and present my findings, which will contribute to the strategic decision-making process at Bellabeat.\n","\n","### Business Requirement\n","\n","To leverage [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) as a data proxy, the goal is to detect patterns or trends that can offer valuable insights to help Bellabeat develop their smart-device line and establish a dominant position in the market. Three relevant questions were done by Bellabeat leadership:\n","\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","The provided questions exhibit a broad and comprehensive scope, offering an extensive framework for analysis.\n","\n","### Business metrics\n","\n","While currently a successful small company, Bellabeat holds the potential to become a major player in the global smart device market. Recognizing this opportunity, Urška Sršen, the cofounder and Chief Creative Officer of Bellabeat, firmly believes that analyzing fitness data from smart devices could serve as a catalyst for unlocking new avenues of growth for the company.\n","\n","* The sole purpose of the device is to collect the walking activity in different range (1): \n","\n","    * Very active\n","    * Moderated activity\n","    * Light activity\n","    * Idle activity (sleeping and rest).\n","\n","\n","* Record the calculated **Metabolic Equivalent Task (METs)**, and **Caloric Expediture** base on current Age, Gender, Weight and type of Activity (2).\n","* The collection of data is timestamped based on different intervals: daily, hourly, and minute measurements, depending on the specific metric being recorded.\n","\n","(1) Note: Walking activity is assumed based on the exisiting records, no other type of activity (swiming, biking, basketball, baseball, etc.) was registered.[***See Process section for more details.***](#Process)\n","    \n","(2) Note: The calculation of metabolic equivalent task and caloric expenditure dependent on various factors such as Age, Gender, Activity type, and Body Weight. These variables are essential for accurate calculations.\n","However, during the data exploratory analysis, no records were found that track the aforementioned variables within the current dataset (FitBit Fitness Tracker Data). The dataset does include a daily log record file called\n","\"weightLogInfo_merged.csv,\"but it only contains Weight and Body Mass Index (BMI) data, which is available in a limited number of samples (8 samples). Consequently, this dataset is not suitable for conducting an in-depth\n","analysis on these variables.[***See Process section for more details.***](#Process)\n","\n","Although the data set includes files with observations for the daily, hourly, and minute time frames, this analysis will focus on the daily and hourly time frame.[***See Process section for more details.***](#Process)\n","\n","### Business Tasks\n","\n","* Find any hourly distribution of the average of activities.\n","* Find correlation between caloric expediture and steps\n","* Find correlation between metabolic equivalent task (METs) and steps\n","* Find correlation between average of daily sleep time and daily high performance activity\n","* Using data visualization as exploratory tool\n","\n"]},{"cell_type":"markdown","id":"5c19ad2c","metadata":{"papermill":{"duration":0.006101,"end_time":"2023-07-19T19:53:11.783217","exception":false,"start_time":"2023-07-19T19:53:11.777116","status":"completed"},"tags":[]},"source":["## **Prepare**\n","\n","\n","### Data\n","\n","To conduct this analysis, the [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) was selected as a data proxy. The choice of this dataset is based on its alignment with the requirements of the company, [Bellabeat](https://bellabeat.com/), and the intrinsic functionalities of their smart devices line of products. However, it is important to consider the limitations and context of this dataset when drawing conclusions from the analysis.\n","\n","One particular concern is the potential bias introduced by the small sample size, which could impact the reliability of the results. The usability score, although reported as high based on the Kaggle calculations, should be interpreted with caution due to the limited number of observations. The statistical significance of the findings may be affected by the small sample size.\n","\n","Therefore, it is crucial to acknowledge the limitations of the dataset and exercise prudence when interpreting the results. While the FitBit Fitness Tracker Data can provide valuable insights, it is advisable to be aware of the potential bias introduced by the small sample size. It is recommended to consider these limitations when drawing conclusions and to test any important insights with a larger sample for better generalizability and reliability of the findings.\n","\n","All the limitations and constraints of the data were thoroughly discussed with the stakeholders of Bellabeat. During these discussions, Mr. Urška Sršen, Bellabeat's co-founder and Chief Creative Officer, recommended the inclusion of additional data to address the existing limitations and enhance the overall data quality.\n","\n","To enhance our comprehension of the data and address considerations such as bias, integrity, and contextual relevance, a comprehensive research effort was undertaken. This extensive research aimed to identify potential biases, ensure data integrity, provide valuable context, and identify suitable supplemental data sources that could augment the existing dataset. By conducting this thorough investigation, we aimed to gain deeper insights and ensure the completeness and accuracy of our analysis. \n","\n"," * [ScienseDirect: Metabolic Equivalent](https://www.sciencedirect.com/topics/medicine-and-dentistry/metabolic-equivalent)\n"," * [Sleep Foundation: How Much Sleep Do We Really Need?](https://www.sleepfoundation.org/how-sleep-works/how-much-sleep-do-we-really-need)\n"," * [National Library Of Medicine: The bidirectional relationship between exercise and sleep: Implications for exercise adherence and sleep improvement](https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4341978/)\n"," \n","***Note: Not reliable supplemental data source was found.***\n","\n","Although the dataset may not be extensive, it still holds the potential to provide valuable insights that meet the requirements of Bellabeat stakeholders. While the dataset's size may be limited, it is important to acknowledge that even a smaller dataset can yield significant findings and valuable information. By employing appropriate data analysis techniques and considering the specific objectives of Bellabeat stakeholders, we can extract meaningful insights that address their needs and inform decision-making processes. Therefore, despite its size, the dataset possesses the capacity to offer valuable information and contribute to the satisfaction of Bellabeat's requirements.\n","\n","### Data Storage\n","\n","For the purpose of this analysis, the data will be stored in the project folder ***(/kaggle/input/fitbit/Fitabase Data 4.12.16-5.12.16)*** in its original CSV format."]},{"cell_type":"markdown","id":"b4428637","metadata":{"papermill":{"duration":0.006011,"end_time":"2023-07-19T19:53:11.795424","exception":false,"start_time":"2023-07-19T19:53:11.789413","status":"completed"},"tags":[]},"source":["## **Process**\n","The programming language R and the supplemental libraries Tidyverse, dplyr, ggplot2 will be used:\n","\n","* Utilize the **Dplyr** library to conduct data exploration. **Dplyr** is a powerful data manipulation tool that offers a cohesive set of verbs, enabling streamlined solutions to common data manipulation challenges. By leveraging the dplyr library, you can efficiently explore and analyze the data, benefiting from its consistent and intuitive grammar of data manipulation.\n","* The data was cleaned using the **Tidyverse** library, which is a curated collection of R packages specifically designed for data science tasks. **Tidyverse** packages adhere to a consistent design philosophy, grammar, and data structures, making them highly suited for efficient and streamlined data manipulation and analysis. By utilizing the Tidyverse library, we were able to effectively clean and prepare the data for further analysis and exploration.\n","* For creating visualizations, the **Ggplot2** library was utilized. **Ggplot2** is a powerful graphics system that enables the creation of visual representations in a declarative manner, following the principles of The Grammar of Graphics. By leveraging **Ggplot2**, we were able to generate insightful and customizable visualizations that effectively communicate the data patterns and relationships.\n","* Normalize timestamps and dates with **Lubridate**, make dealing with Dates a little easier.\n","\n","### Data Sources (See [Schema](#Schema) for more details)\n","\n","* **dailyActivity_merged.csv:** A daily consolidated of most of the measures. Contain activity for 33 participant\n","* **dailyCalories_merged.csv:** Continous data on Continous data on Daily Caloric expediture measures. Contain activity for 33 participant\n","* **dailyIntensities_merged.csv:** Continous data on Continous data on Daily Activity Intensity measures. Contain activity for 33 participant. \n","* **dailySteps_merged.csv:** Continous data on Continous data on Daily steps count measures. Contain activity for 33 participant\n","* **heartrate_seconds_merged.csv:** Continous data on Heart rate by second. Contain activity for 14 participant. Not suficient and it will not be included in the analysis.\n","* **hourlyIntensities_merged.csv:** Continous data on Continous data on Hourly Intensity measures. Contain activity for 33 participant\n","* **minuteIntensitiesNarrow_merged.csv:** Narrow format of the Activity Intensity by minute. Contain activity for 33 participant\n","* **minuteIntensitiesWide_merged.csv:** Wide format of the Activity Intensity by minute. Contain activity for 33 participant\n","* **hourlySteps_merged.csv:** Continous data on Hourly Step count.Contain activity for 33 participant\n","* **hourlyCalories_merged.csv:** Continous data on Continous data on Hourly caloric expediture measure. Contain activity for 33 participant\n","* **minuteCaloriesNarrow_merged.csv:**  Narrow format of the Caloric Expediture by minute. Contain activity for 33 participant\n","* **minuteCaloriesWide_merged.csv:**  Wide format of the Caloric Expediture by minute. Contain activity for 33 participant\n","* **minuteMETsNarrow_merged.csv:** Continous data on Continous data on Metabolic Equivalent Task measures by minute. Contain activity for 33 participant\n","* **minuteSleep_merged.csv:** Continous data on Continous data on Sleep time in minute. Contain activity for 24 participant\n","* **sleepDay_merged.csv:** Summary of daily Sleep time. Contain activity for 24 participant\n","* **weightLogInfo_merged.csv:** Continous data on Continous data on Weight Log. Contain activity for 8 participant. Not suficient and it will not be included in the analysis.\n","\n","\n","### Cleaning strategies\n","\n","Data set offers observations for three time frames: daily, hourly and minute. For this analysis the data will be cleaned using the following steps:\n","\n","* Date and time normalization, timestamps will be splited in date, and time in a homogeneous format.\n","* Any null or NA record will be removed\n","* File \"weightLogInfo_merged.csv\" will be excluded from this analysis, even when the file contain valuable observations as Weight (Kg and pounds) and Body Mass Index (BMI), the amount of samples in record are insignificant for this analysis.\n","\n","### 1) **Setup environment**"]},{"cell_type":"code","execution_count":1,"id":"c386a513","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2023-07-19T19:53:11.813712Z","iopub.status.busy":"2023-07-19T19:53:11.811347Z","iopub.status.idle":"2023-07-19T19:53:12.910728Z","shell.execute_reply":"2023-07-19T19:53:12.909036Z"},"papermill":{"duration":1.11066,"end_time":"2023-07-19T19:53:12.913424","exception":false,"start_time":"2023-07-19T19:53:11.802764","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \